#Exercise 2

set1 = {3, 14, 15, 9, 26, 5, 35, 9}
set2 = {60, 22, 14, 0, 9}

print(f'set1: {set1}\nset2: {set2}')

intersection = set1 & set2
print(f'Intersection set 1 & set2: {intersection}')
difference_1_2 = set1-set2
print(f'Difference set 1 - set2: {difference_1_2}')
union = set1 | set2
print(f'Union set 1 | set2: {union}')
sym_diff = set1 ^ set2
print(f'Simmetric difference set 1 ^ set2: {sym_diff}')

print('--------------------------------------------------')

